import React, {useEffect} from 'react';
import { useState } from 'react';


const Welcome = () => {

    const callWelcome = async () => {
        try{
            const res = await fetch('/About', {
                method: "GET", 
                headers: {"Content-Type": "application/json"},
                credentials: 'include'
            });
            const data = await res.json();
            console.log(data);
        }
        catch(err)
        {
            console.log(err)
        }
    }
    useEffect( () => {
      callWelcome()      
    }, []);

    return (
        <>
        <div className="aaa">
            <form method="GET">
            <p>Welcome </p>
            <button onClick={callWelcome}></button>
            </form>
        </div>
        </>
    )

}

export default Welcome;
